INSERT INTO `sys_oper_log` VALUES (183, '大厅网点', 2, 'com.ruoyi.project.business.hallSite.controller.HallSiteController.editSave()', 'POST', 1, 'admin', '研发部门', '/business/hallSite/edit', '127.0.0.1', '内网IP', '{\"unid\":[\"1487267954762039298\"],\"siteName\":[\"河南省政务服务中心\"],\"siteCode\":[\"H410000000000C00001\"],\"sitePhone\":[\"18062066962\"],\"siteAddress\":[\"郑州市金水区农业南路祥盛街向东300米路南\"],\"siteCoordinateY\":[\"111\"],\"siteCoordinateX\":[\"22\"],\"areaCode\":[\"410000\"],\"remark\":[\"1\",\"\"],\"siteAccepttime\":[\"09:00-17:00\"],\"siteIntroduction\":[\"<span style=\\\"display:none;\\\"></span> \\\\n<p>\\\\n\\\\t<span style=\\\"font-size:16px;line-height:2;\\\">&nbsp; </span><span style=\\\"font-size:14px;line-height:2;\\\"><span style=\\\"font-size:16px;line-height:2;\\\">河南省政务服务大厅位于郑东新区农业南路与祥盛街交叉口向东100米路南，中原出版传媒集团D座1至3层，总建筑面积约8700㎡，进驻部门39个，审批人员220余名、综合服务人员100余名，办理省级涉企审批服务事项2214个。其中：一楼受理大厅为群众现场办事区域，围绕“导、问、收、办、评、诉”审批服务全链条，设置咨询辅导区、业务受理区、网办专区、自助服务区、有诉即办专区等13个主要功能分区，共3679㎡。二楼、三楼为后台审批区，设有审批办公室、集中会商会审室、联审联批室、档案周转室等功能，面积共4500㎡。</span></span> \\\\n</p>\\\\n<p>\\\\n\\\\t<span style=\\\"font-size:16px;line-height:2;\\\">&nbsp; 省政务服务大厅围绕全面落实“一门一窗、一站一次、一网一键、一制一章”，实行“前台综合受理、后台分类审批、统一窗口出件”的审批服务新模式。根据群众办事需求和业务关联性,设置民生服务、企业服务、即办业务、社会事务、公共服务、综合服务等6个受理专区84个窗口，设置咨询台、服务台、投诉台、志愿者服务台、自助取件柜、EMS快递服务、咨询辅导区等服务设施，配备叫号机、查询机、自助服务终端等设备，努力打造功能完善、设施齐备、环境舒适的办事平台，权力阳光运行的监督平台，使省政务服务大厅成为全省优化营商环境的主战场、展示政府形象的主窗口、便民利企的主力军，全面助力“两个确保、十大战略”落实。</span> \\\\n</p>\"],\"modifyTime\":[\"2022-04-30\"],\"isDel\":[\"1\"],\"sourceFlag\":[\"zs\"]}', '{\"msg\":\"操作成功\",\"code\":0}', 0, NULL, '2022-05-30 18:27:32');
